    var handlePainAssessmentConcepts = function () {
        var painAssessmentSections = form.find(form.rootRecord, 'Pain Assessment');
        for (var i = 0; i < painAssessmentSections.length; i++) {
            var painScore = form.get('PA, Pain Score', i).getValue();
            if (painScore != undefined && painScore > 0) {
                form.get('PA, Side of pain', i).setHidden(false);
                form.get('PA, Site of pain', i).setHidden(false);
                form.get('PA, Type of pain', i).setHidden(false);
                form.get('PA, When does the pain occur', i).setHidden(false);


            } else {
                form.get('PA, Side of pain', i).hideAndClear();
                form.get('PA, Site of pain', i).hideAndClear();
                form.get('PA, Type of pain', i).hideAndClear();
                form.get('PA, When does the pain occur', i).hideAndClear();
                form.get('PA, Site of pain, other', i).hideAndClear();


            }
        }
    };

    var handleStumpExaminationConcept = function () {
        var stumpExaminationSections = form.find(form.rootRecord, 'Stump examination');
        for (var i = 0; i < stumpExaminationSections.length; i++) {
            if (form.get('AA, Stump shape', i).getValue() == 'Small or conical') {
                form.get('AA, Small or conical, stump description', i).setHidden(false);
            } else {
                console.log('type of assesmment');
                form.get('AA, Small or conical, stump description', i).hideAndClear(true);
            }
        }
    };

    if (form.get('AA, Type of assessment').getValue() === 'Initial assessment (pre-fitting)') {
        form.get('PA, Previous history of physiotherapy').setHidden(false);
        form.get('AA, Date of amputation').setHidden(false);
