        form.get('AA, Description of balance').setHidden(false);
        form.get('AA, Description of walking').setHidden(false);
        form.get('PA, Problem List').setHidden(false);
        form.get('PA, Treatment goals').setHidden(false);
        form.get('PA, Treatment plan and exercises').setHidden(false);
        form.get('PA, Frequency of treatment (sessions / week)').setHidden(false);
        form.get('PA, Estimated duration per session').setHidden(false);
        form.get('PA, Additional comments').setHidden(false);
        form.get('Pain Assessment').setHidden(false);
        handlePainAssessmentConcepts();
        if (form.getFromParent("AA, Does the patient have phantom pain").getValue() === "Yes")
        {
        form.getFromParent("AA, Description of phantom pain").setHidden(false);
        } else
        {
        form.getFromParent("AA, Description of phantom pain").hideAndClear(true);
        }
        form.get('Stump examination').setHidden(false);
        handleStumpExaminationConcept();
        form.get('Stump measurements').setHidden(false);
        form.get('AA, Date of fitting').hideAndClear();
        form.get('AA, P and O center').hideAndClear();
        form.get('AA, LCI score').hideAndClear();
        form.get('PA, Physiotherapy treatment provided to patient in BMRC').hideAndClear();
        form.get('PA, Reason for discharge from physiotherapy').hideAndClear();
        form.get('PA, Home exercises / Family training').hideAndClear();
        form.get('Discharge').hideAndClear();


