        form.get('Stump examination').setHidden(false);
        handleStumpExaminationConcept();
        form.get('PA, Details of previous physiotherapy').hideAndClear();
        form.get('Level of amputation').hideAndClear();
        form.get('PA, Physiotherapy treatment provided to patient in BMRC').hideAndClear();
        form.get('PA, Reason for discharge from physiotherapy').hideAndClear();
        form.get('PA, Home exercises / Family training').hideAndClear();
        form.get('PA, Previous history of physiotherapy').hideAndClear();
